window.bookSummaryJSON = "<p><b><i>The Princess Will Save You</i></b><b> is a YA fantasy adventure inspired by </b><b><i>The Princess Bride</i></b><b>, in which a princess must rescue her stable boy true love, from the acclaimed author of </b><b><i>Sea Witch</i></b><b>, Sarah Henning.</b></p> <p><b>When a princess' commoner true love is kidnapped to coerce her into a political marriage, she doesn't give in - she goes to rescue him.</b></p> <p>When her warrior father, King Sendoa, mysteriously dies, Princess Amarande of Ardenia is given what would hardly be considered a choice: Marry a stranger at 16 or lose control of her family's crown.</p> <p>But Amarande was raised to be a warrior - not a sacrifice.</p> <p>In an attempt to force her choice, a neighboring kingdom kidnaps her true love, stable boy Luca. With her kingdom on the brink of civil war and no one to trust, she'll need all her skill to save him, her future, and her kingdom.</p>"; 
